import React from "react";
import tiziano from "rick_and_morty/src/components/About/img/foto-mia-actual.jpg"

export default function About() {
    return (
      <div>
        <h2>About Me</h2>
        <img src={tiziano} alt="Tiziano" />
        <p>¡Hola! Soy Tiziano Rios, el creador de esta aplicación.
          Tengo 19 años, y estoy muy emocionado por recibirme como 
          programador y poder trabajar de lo que más me gusta.
        </p>
        <p>En esta aplicación, puedes ver un poco de todo lo que estoy aprendiendo en Henry.</p>
        <p>¡Espero que disfrutes usando la aplicación!</p>
      </div>
    );
}
